#!usr/bin/env python3
dna=''
rev_dna=dna[::-1]
T_to_a=rev_dna.replace('T','a')
A_to_t=T_to_a.replace('A','t')
G_to_c=A_to_t.replace('G','c')
C_to_g=G_to_c.replace('C','g')
compl_dna=C_to_g.upper()





EcoRI=compl_dna.find('GAATTC')
EcoRI_index=(EcoRI+1)
EcoRI_end=(EcoRI_index+5)
print(f"startPos:{EcoRI_index},endPos:{EcoRI_end}")



